import {
    IoIosBarcode,
    IoIosCash,
    IoIosFlask,
    IoIosOptions,
    IoIosPaw,
    IoIosThunderstorm,
    IoIosToday,
    IoIosTrendingUp,
    IoIosLogoIonnic
} from 'react-icons/io'
export default function ProjectSquare() {
    const iconSelector = () => {
        let rand = Math.floor(Math.random * (icons.length-1))
        const icons = [
            <IoIosBarcode />,
            <IoIosCash />,
            <IoIosFlask />,
            <IoIosOptions />,
            <IoIosPaw />,
            <IoIosThunderstorm />,
            <IoIosToday />,
            <IoIosTrendingUp />,
            <IoIosLogoIonnic />
        ]
        return icons[rand]
    }

    return (
        <div className="projectSquare flex flex-column border">
            <h3 className="font-f1 text-center text-white"></h3>
        </div>
    )
}
